import { HttpClient } from '@angular/common/http';
import { Component } from '@angular/core';
import { DatePipe } from '@angular/common';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  public games?: GamePredictionDTO[];

  constructor(http: HttpClient) {
    http.get<GamePredictionDTO[]>('http://localhost:5256/predictions/games/get').subscribe(result => {
      this.games = result.sort((n1, n2) => {
        if (n1.weekNumber > n2.weekNumber) {
          return 1;
        }

        if (n1.weekNumber < n2.weekNumber) {
          return -1;
        }

        return 0;
      });
    }, error => console.error(error));
  }

  title = 'angularapp';
}

interface GamePredictionDTO {
  homeTeamName: string;
  homeTeamAcronym: string;
  awayTeamName: string;
  awayTeamAcronym: string;
  gameDate: Date;
  homeTeamWinChance: number;
  awayTeamWinChance: number;
  drawChance: number;
  weekNumber: number;
}

<h1 id="tableLabel">Predictions</h1>

<p>pinus.</p>

<p *ngIf="!games"><em>Loading... Please refresh once the ASP.NET backend has started. See <a href="https://aka.ms/jspsintegrationangular">https://aka.ms/jspsintegrationangular</a> for more details.</em></p>

<table *ngIf="games">
    <thead>
      <tr>
        <th>Home Team</th>
        <th>Home Team Acronym</th>
        <th>Home Team Win Chance</th>
        <th>Away Team</th>
        <th>Away Team Acronym</th>
        <th>Away Team Win Chance</th>
        <th>Game Date</th>
        <th>Week</th>
      </tr>
    </thead>
    <tbody>
      <tr *ngFor="let game of games">
        <td>{{ game.homeTeamName }}</td>
        <td>{{ game.homeTeamAcronym }}</td>
        <td>{{ game.homeTeamWinChance | percent }}</td>
        <td>{{ game.awayTeamName }}</td>
        <td>{{ game.awayTeamAcronym }}</td>
        <td>{{ game.awayTeamWinChance | percent }}</td>
        <td>{{ game.gameDate | date:'yyyy/MM/dd' }}</td>
        <td>{{ game.weekNumber }}</td>
      </tr>
    </tbody>
</table>
